"""## Parameter Regresi"""

import seaborn as sns
from statsmodels.formula.api import ols

# Jika kita menggunakan 'book' (data berbentuk 'string')
model = ols('Jumlah_invest ~ penghasilan + tanggungan + pengeluaran + C(dum_usia) + C(dum_daerah) + C(dum_invest)', data=df)
fitted_model = model.fit()
print(fitted_model.summary())

"""## Uji Serentak"""

print('F-hitung = ', fitted_model.fvalue) #F hitung
print('P-value = ', fitted_model.f_pvalue) #P-value

alpha = 0.05

#Daerah penolakan dan keputusan
if fitted_model.f_pvalue > alpha:
	print('gagal tolak H0 artinya tidak ada relasi linier antara Y dan X')
else:
	print('tolak h0 ada relasi linier antara Y dan X')

"""## Uji Parsial"""

print('t-hitung = ', fitted_model.tvalues) #F hitung
print('P-value = ', fitted_model.pvalues) #P-value

