"""#Menguji asumsi autokorelasi"""

import pandas as pd
import statsmodels.api as sm
from statsmodels.stats.stattools import durbin_watson
import numpy as np
import matplotlib.pyplot as plt
from statsmodels.graphics.tsaplots import plot_acf

df = pd.read_csv("Data.csv",sep = ";")

#substitusi data y(dep_var) dan x(indep_var)
dep_var = df['Jumlah_invest']
indep_var = df[['penghasilan', 'tanggungan' , 'pengeluaran','dum_usia',	'dum_daerah',	'dum_invest']]
indep_var = sm.add_constant(indep_var)

#ols result residuals
ols = sm.OLS(dep_var, indep_var)
ols_fit = ols.fit()
residual = ols_fit.resid

#plot
time=list(range(1,385+1))

plt.scatter(time, residual)
plt.xlabel('time order', fontsize=12)
plt.ylabel('residuals', fontsize=12)
plt.show()

#Durbin-Watson test
print('Durbin-Watson :', durbin_watson(residual))

"""DU = 1.5


DL = 2.5


H0 : DU < Durbin-Watson < DL


H1 : Durbin-Watson < DU atau Durbin-Watson > DL

Menerima H0, artinya tidak ada autokorelasi residual yang memengaruhi model regresi

#Menguji Varian error konstan
"""

from statsmodels.stats.diagnostic import het_white

#fitted value
ols_fitted = ols_fit.fittedvalues

#scatter plot
plt.scatter(ols_fitted, residual)
plt.xlabel('y-topi')
plt.ylabel('Residuals')
plt.axhline(y=0, color='black', linestyle='--', linewidth=1)
plt.show()

#Glejser Test
glejser = sm.OLS(abs(residual), indep_var).fit()
print('Glejser P-value :', glejser.f_pvalue)

"""#Menguji error berdistribusi normal"""

from statsmodels.graphics.gofplots import qqplot
import pylab 
import scipy.stats as stats
from scipy.stats import kstest

# membuat q-q plot
stats.probplot(residual, dist="norm", plot=pylab)
pylab.show()

# pakai sm
fig = sm.qqplot(residual, line='s')
plt.show()


# uji normalitas dengan kolmogorov-smirnov test
ks=kstest(residual,'norm')
print('Statistic KS:', ks.statistic.round(4))
print('P-value:', ks.pvalue.round(4))

# interpret
alpha = 0.05
if ks.pvalue > alpha:
	print('Data Berdistribusi Normal (Gagal Tolak H0)')
else:
	print('Data Residual Tidak Berdistribusi Normal (Tolak H0)')

"""H0 = P-value > alpha(0.05)

H1 = P-value < alpha(0.05)

Menolak H0, artinya data residual tidak berdistribusi normal
"""